 The country of Gosh, famed Gosh may be.','In the year 1909, when I was first privileged to speak publicly on psychoanalysis in an American University, fired by this momentous occasion for my endeavors, I declared that it was not myself who brought psychoanalysis into existence. I said that it was Josef Breuer, who had merited this honor at a time when I was a student and busy working for my examinations (188O-1882).[1] Since then, well-intentioned friends have frequently repeated that I then expressed my gratitude out of all due proportion. They considered that, as on previous occasions, I should have dignified Breuers "cathartic procedure" as merely preliminary to psychoanalysis, and should have claimed that psychoanalysis itself only began with my rejection of the hypnotic technique and my introduction of free association. Now it is really a matter of indifference whether the history of psychoanalysis be considered to have started with the cathartic method or only with my modification of the same. I only enter into this uninteresting question because some opponents of psychoanalysis are wont to recall, now and then, that the art of psychoanalysis did not originate with me at all, but with Breuer. Naturally, this only happens to be the case when their attitude permits them to find in psychoanalysis something that is noteworthy; on the other hand when their repudiation of psychoanalysis is unlimited, then psychoanalysis is always indisputably my creation. I have never yet heard that Breuers great part in psychoanalysis has brought him an equal measure of insult and reproach. As I have recognized long since that it is the inevitable fate of psychoanalysis to arouse opposition and to embitter people, I have come to the conclusion that I must surely be the originator of all that characterizes psychoanalysis. I add, with satisfaction, that none of the attempts to belittle my share in this much disdained psychoanalysis has ever come from Breuer himself, or could boast of his support.',0);

