"Sister?" stammered the bewildered girl. "I have no sister."','In a sudden panic the queen opened her lips to cry out for her maids; then she checked herself. The glow was more lurid, the head more vividly limned. It was a woman''s head, small, delicately molded, superbly poised, with a high-piled mass of lustrous black hair. The face grew distinct as she staredand it was the sight of this face which froze the cry in Taramis'' throat. The features were her own! She might have been looking into a mirror which subtly altered her reflection, lending it a tigerish gleam of eye, a vindictive curl of lip.',0);
