Even science has lost her dispassionate impartiality. Her deeply embittered votaries are intent upon seizing her weapons to do their share in the battle against the enemy. The anthropologist has to declare his opponent inferior and degenerate, the psychiatrist must diagnose him as mentally deranged. Yet it is probable that we are affected out of all proportion by the evils of these times and have no right to compare them with the evils of other times through which we have not lived.

The individual who is not himself a combatant and therefore has not become a cog in the gigantic war machinery, feels confused in his bearings and hampered in his activities. I think any little suggestion that will make it easier for him to see his way more clearly will be welcome. Among the factors which cause the stay-at-home so much spiritual misery and are so hard to endure there are two in particular which I should like to emphasize and discuss. I mean the disappointment that this war has called forth and the altered attitude towards death to which it, in common with other wars, forces us.','',1,NULL,2,2,3,2,1,1,'Freudian','https://secure.wikimedia.org/wikisource/en/wiki/Reflections_on_War_and_Death/I','','2011-08-22 05:37:18','2011-08-22 05:37:18');

It is clear that no doubt was felt by Henry or by Geoffrey himself, while both Richard and John always acknowledged Geoffrey as their brother, and Richard even suspected him of a design upon the crown, which could scarcely have entered the head of any one if his origin had been generally doubted. Map may have exaggerated the social degradation of Geoffrey''s mother. From the fact that William Longsword, son of an elder William Longsword, who was an illegitimate son of Henry II, laid claim in the reign of Henry III to the estates of one Roger of Akeny, which suggests Ykenai, the late Mr. J. F. Dimock conjectured that these names might possibly be identical, and that Geoffrey''s mother might be a knight''s daughter or sister of Norman origin (Gir. Cambr. Opp. vii. pref. xxxvii). ','',2,NULL,1,1,3,4,1,1,'','https://secure.wikimedia.org/wikisource/en/wiki/Geoffrey_%28d.1212%29_%28DNB00%29','','2011-08-22 06:40:42','2011-08-22 06:40:42');
