INSERT INTO "person" VALUES(8,'jiechu@example.com','cbcefaf71b4677cb8bcc006e0aeaa34a','2011-08-22 11:42:36.833933','2011-08-22 04:59:04','573b05118813b8e13de5591104913820',0,'Jie','Chu','6/23 Kogil Street','','Bellata','NSW','2397','AUSTRALIA','Jie Chu International','(02) 6740 0369','0467 400 369','http://example.com/jiechu','The content of Breuers discovery has been so often presented that a detailed discussion of it here may be omitted. Its fundamental fact is that the symptoms of hysterical patients depend upon impressive but forgotten scenes in their lives (traumata). The therapy founded thereon was to cause the patients to recall and reproduce these experiences under hypnosis (catharsis), and the fragmentary theory, deduced from it was that these symptoms cor responded to an abnormal use of undischarged sums of excitement (conversion). In his theoretical contribution to the "Studies of Hysteria" Breuer, wherever obliged to mention conversion, has always added my name in parenthesis, as though this first attempt at a theoretical formulation was my mental property. I think this allotment refers only to the nomenclature, whilst the conception itself occurred to us both at the same time.
INSERT INTO "person" VALUES(9,'samanthabrennan@example.com','2f7cdf67387a8eaca8a7589119ab7797','2011-08-22 11:45:41.841711','2011-08-22 05:37:18','05f5c73119f628f41644d5aa4cdf8201',1,'Samantha','Brennan','22, rue des Chaligny','','Nice','','06100','FRANCE','','04.78.14.05.52','n/a','http://example.com/samanthabrennan','Trusting to this unity of civilized races countless people left hearth and home to live in strange lands and trusted their to the friendly relations existing between the various countries. And even he who was not tied down to the same spot by the exigencies of life could combine all the advantages and charms of civilized countries into a newer and greater fatherland which he could enjoy without hindrance or suspicion. He thus took delight in the blue and the grey ocean, the beauty of snow clad mountains and of the green lowlands, the magic of the north woods and the grandeur of southern vegetation, the atmosphere of landscapes upon which great historical memories rest, and the peace of untouched nature. The new fatherland was to him also a museum, filled with the treasure that all the artists of the world for many centuries had created and left behind. While he wandered from one hall to another in this museum he could give his impartial appreciation to the varied types of perfection that had been developed among his distant compatriots by the mixture of blood, by history, and by the peculiarities of physical environment. Here cool, inflexible energy was developed to the highest degree, there the graceful art of beautifying life, elsewhere the sense of law and order, or other qualities that have made man master of the earth.','These frequently over strict precepts demanded a great deal of him, a great self-restraint and a marked renunciation of his impulses. Above all he was forbidden to resort to lying and cheating, which are so extraordinarily useful in competition with others. The civilized state considered these moral standards the foundation of its existence, it drastically interfered if anyone dared to question them and often declared it improper even to submit them to the test of intellectual criticism. It was therefore assumed that the state itself would respect them and would do nothing that might contradict the foundations of its own existence. To be sure, one was aware that scattered among these civilized nations there were certain remnants of races that were quite universally disliked, and were therefore reluctantly and only to a certain extent permitted to participate in the common work of civilization where they had proved themselves sufficiently fit for the task. But the great nations themselves, one should have thought, had acquired sufficient understanding for the qualities they had in common and enough tolerance for their differences so that, unlike in the days of classical antiquity, the words "foreign" and "hostile" should no longer be synonyms.',0);
INSERT INTO "person" VALUES(10,'nabeehanoorsamaha@example.com','356459257b1c47526d148d9c34a807f7','2011-08-22 11:47:25.972069','2011-08-22 06:05:38','efaffb929524563b0653a8c71d9e33b9',1,'Nabeeha Noor','Samaha','3609 Hillhaven Drive','','Los Angeles','CA','90029','UNITED STATES','','323-906-5016','n/a','http://example.com/nabeehanoorsamah','"Ishtar!" gasped Taramis. "I am bewitched!"
INSERT INTO "person" VALUES(11,'antoninmarek@example.com','5f4dcc3b5aa765d61d8327deb882cf99','2011-08-22 11:49:22.431866','2011-08-22 06:40:42','3cfa3296cbe0a6d133d264d1f6c6db31',1,'Antonn','Marek','3819 MacLaren Street','','Ottawa','ON','K1P 5M7','CANADA','','613-593-1351','I don''t have one','','Gerald of Wales, in his ''Life of Geoffrey of York,'' says that Geoffrey was scarcely twenty when appointed bishop of Lincoln, i.e. in April 1173, and elsewhere that he was about forty when consecrated to York, i.e. in August 1191. Neither of the dates thus indicated for his birth, 1151 or 1153, is in itself impossible. The later date seems the more probable. Map''s language would seem to imply that he was regarded as an Englishman by birth. Map says that Ykenai presented him to the king ''at the beginning of his reign.''','ed between Geoffrey and the elder William Longsword renders it very improbable that they were sons of the same mother. Some modern writers have referred to the ''Chronicle of Kirkstall'' as authority for the statement that Geoffrey was born in 1159. But the ''Kirkstall Chronicle'' in its present form dates only from the reign of Henry V; and the ''Galfridus filius regis [Henrici] secundi'' whose birth it records is clearly Geoffrey''s half-brother, Queen Eleanor''s child of the same name, who certainly was born in September 1158.',0);
