INSERT INTO "proposal" VALUES(1,'The History of the Psychoanalytic Movement - by Sigmund Freud, translated by A. A. Brill','If in what follows I bring any contribution to the history of the psychoanalytic movement nobody must be surprised at the subjective nature of this paper, nor at the role which falls to me therein. For psychoanalysis is my creation; for ten years I was the only one occupied with it, and all the annoyance which this new subject caused among my contemporaries has been hurled upon my head in the form of criticism. Even today, when I am no longer the only psychoanalyst, I feel myself justified in assuming that none can know better than myself what psychoanalysis is, wherein it differs from other methods of investigating the psychic life, what its name should cover, or what might better be designated as some thing else.
