INSERT INTO "proposal" VALUES(3,'Reflections on War and Death  (1918)  by Sigmund Freud -  translated by Abraham Arden Brill and Alfred B. Kuttner','CAUGHT in the whirlwind of these war times, without any real information or any perspective upon the great changes that have already occurred or are about to be enacted, lacking all premonition of the future, it is small wonder that we ourselves become confused as to the meaning of impressions which crowd in upon us or of the value of the judgments we are forming. It would seem as though no event had ever destroyed so much of the precious heritage of mankind, confused so many of the clearest intellects or so thoroughly debased what is highest.
INSERT INTO "proposal" VALUES(4,'A Witch Shall Be Born by Robert Ervin Howard','Taramis, Queen of Khauran, awakened from a dream-haunted slumber to a silence that seemed more like the stillness of nighted catacombs than the normal quiet of a sleeping place. She lay staring into the darkness, wondering why the candles in their golden candelabra had gone out. A flecking of stars marked a gold-barred casement that lent no illumination to the interior of the chamber. But as Taramis lay there, she became aware of a spot of radiance glowing in the darkness before her. She watched, puzzled. It grew and its intensity deepened as it expanded, a widening disk of lurid light hovering against the dark velvet hangings of the opposite wall. Taramis caught her breath, starting up to a sitting position. A dark object was visible in that circle of lighta human head.','',1,NULL,1,1,3,1,1,1,'Avon Fantasy Reader','https://secure.wikimedia.org/wikisource/en/wiki/Avon_Fantasy_Reader/Issue_10/A_Witch_Shall_Be_Born/Chapter_I','','2011-08-22 06:05:38','2011-08-22 06:05:38');
INSERT INTO "proposal" VALUES(5,'Geoffrey, Archbishop of York','GEOFFREY (d. 1212), archbishop of York, has been generally described as a son of Henry II and ''Fair Rosamond'' [see Clifford, Rosamond]. This claim is quite untenable. The only contemporary writer who gives any account of Geoffrey''s mother, Walter Map, says that she was a woman of the most degraded character, named Ykenai or Hikenai, and that she persuaded the young king to acknowledge Geoffrey as his son, despite a general assurance to the contrary (W. Map, De Nug. Curial, dist. v. c. 6). All the other writers of the time habitually describe Geoffrey as ''the king''s son,'' without hinting a doubt of his paternity. Gervase of Canterbury when seeking to discredit Geoffrey calls him ''regio natus  sanguine, ut putabatur'' (Gerv. Cant. i. 520). Elsewhere he describes him as ''frater regis, sed nothus,'' without further remark. 
